import React, { Component } from 'react';

class Header extends Component {
  static displayName = Header.name;

  render () {
    return (
      <div className="h-16 w-full border-b border-gray-200">
        <div className='pt-3 pb-3 max-w-3xl mx-auto flex justify-between'>
          <div className='text-3xl'>Watermango</div>
          <div className='py-2 px-5 border-2 border-green-400 cursor-pointer'>Login</div>
        </div>
      </div>
    );
  }
}

export default Header;
